import React from 'react';
import './ExpenseFilter.css';

const ExpenseFilter = () =>{
    return (
    <div className="expenses-filter">
        <select>
            <option>2018</option>
            <option>2019</option>
            <option>2020</option>
            <option>2021</option>
        </select> 

    </div>
    );
};

export default ExpenseFilter;
